import React from 'react'
import * as S from './navbar.style'
import useAuthenticated from 'src/hooks/useAuthenticated'

export default function Navbar() {
  const authenticated = useAuthenticated()
  return (
    <S.Navbar>
      <S.NavMenu></S.NavMenu>
    </S.Navbar>
  )
}
